import {Table} from 'react-bootstrap';
import '../Estilos/Carrinho.css';

export default function CarrinhoComponente(props) {
    return (
        <tbody>
            <tr key={props.id}>
                <td width="20%">
                    <img className="imagemProduto" src={require(`./imgs/${props.imagem}`).default} />
                </td>
                <td width="20%" className="nomeProduto">{props.descricao}</td>
                <td width="20%" className="precoProduto">R$ {props.precoVenda}</td>
                <td width="20%" className="quantidadeProduto">{props.quantidade}</td>
                <td width="20%">
                    <button type="button" className="btn-danger">X</button>
                    <button type="button" className="btn-success">+</button>
                </td>
            </tr>
        </tbody>
    )
}
